import React, { Component } from 'react';
import Menu from './menu/Menu';
import Usuarios from './usuarios/index/Contenido';
import CrearUsuario from './usuarios/crear/Crear';
import EditarUsuario from './usuarios/editar/Editar';
import Preguntas from './preguntas/index/IndexPreguntas';
import EditarPregunta from './preguntas/editar/EditarPregunta';
import CrearPregunta from './preguntas/crear/CrearPregunta';
import Respuestas from './respuestas/index/IndexRespuestas';
import EditarRespuesta from './respuestas/editar/EditarRespuesta';
import CrearRespuesta from './respuestas/crear/CrearRespuesta';
import Modulos from './modulos/index/IndexModulos';
import EditarModulo from './modulos/editar/EditarModulo';
import CrearModulo from './modulos/crear/CrearModulo';
import Subtemas from './subtemas/index/IndexSubtemas';
import EditarSubtema from './subtemas/editar/EditarSubtema';
import CrearSubtema from './subtemas/crear/CrearSubtema';
import Tarjetas from './tarjetas/index/IndexTarjetas';
import EditarTarjeta from './tarjetas/editar/EditarTarjeta';
import CrearTarjeta from './tarjetas/crear/CrearTarjeta';
import TarjetasSaberMas from './tarjetasSaberMas/index/IndexTarjetasSaberMas';
import EditarTarjetaSaberMas from './tarjetasSaberMas/editar/EditarTarjetaSaberMas';
import CrearTarjetaSaberMas from './tarjetasSaberMas/crear/CrearTarjetaSaberMas';
import PreguntasT from './preguntasTrivia/index/IndexPreguntasT';
import EditarPreguntaT from './preguntasTrivia/editar/EditarPreguntaT';
import CrearPreguntaT from './preguntasTrivia/crear/CrearPreguntaT';
import RespuestasT from './respuestasTrivia/index/IndexRespuestasT';
import EditarRespuestaT from './respuestasTrivia/editar/EditarRespuestaT';
import CrearRespuestaT from './respuestasTrivia/crear/CrearRespuestaT';
import Recursos from './recursos/index/IndexRecursos';
import EditarRecurso from './recursos/editar/EditarRecurso';
import CrearRecurso from './recursos/crear/CrearRecurso';
import Exportar from './exportar/Exportar';
import { BrowserRouter, Route, Switch, Redirect } from 'react-router-dom';
import './Dashboard.css';
class Dashboard extends Component {

    constructor(props) {
        super(props);
        this.state = {
            user_to_edit: ''
        }
    }


    userToEdit = (id) => {
        this.setState({
            user_to_edit: id
        })
    }
    render() {
        return (
            <div id="main">
                <BrowserRouter>
                    <header>
                        <div className="navbar-fixed">
                            <nav>
                                <div className="nav-wrapper">
                                    <a href="#!" className="brand-logo">Logo</a>
                                    <ul className="right hide-on-med-and-down">
                                        <li><a href="badges.html" onClick={() => this.props.changeLogin}>Cerrar sesión</a></li>
                                    </ul>
                                </div>
                            </nav>
                        </div>
                        <Menu />
                    </header>
                    <main>
                        <Redirect from="/"
                            to="/" />
                        <Switch>
                            <Route exact path='/' component={() => <Usuarios userToEdit={this.userToEdit.bind(this)} />} />
                            <Route exact path='/crear' component={CrearUsuario} />
                            <Route exact path='/editar' component={EditarUsuario} />
                            <Route exact path='/preguntas' component={Preguntas} />
                            <Route exact path='/editarPregunta' component={EditarPregunta} />
                            <Route exact path='/crearPregunta' component={CrearPregunta} />
                            <Route exact path='/respuestas' component={Respuestas} />
                            <Route exact path='/editarRespuesta' component={EditarRespuesta} />
                            <Route exact path='/crearRespuesta' component={CrearRespuesta} />
                            <Route exact path='/modulos' component={Modulos} />
                            <Route exact path='/editarModulo' component={EditarModulo} />
                            <Route exact path='/crearModulo' component={CrearModulo} />
                            <Route exact path='/subtemas' component={Subtemas} />
                            <Route exact path='/editarSubtema' component={EditarSubtema} />
                            <Route exact path='/crearSubtema' component={CrearSubtema} />
                            <Route exact path='/tarjetas' component={Tarjetas} />
                            <Route exact path='/editarTarjeta' component={EditarTarjeta} />
                            <Route exact path='/crearTarjeta' component={CrearTarjeta} />
                            <Route exact path='/tarjetasSM' component={TarjetasSaberMas} />
                            <Route exact path='/editarTarjetaSM' component={EditarTarjetaSaberMas} />
                            <Route exact path='/crearTarjetaSM' component={CrearTarjetaSaberMas} />
                            <Route exact path='/preguntasT' component={PreguntasT} />
                            <Route exact path='/editarPreguntaT' component={EditarPreguntaT} />
                            <Route exact path='/crearPreguntaT' component={CrearPreguntaT} />
                            <Route exact path='/respuestasT' component={RespuestasT} />
                            <Route exact path='/editarRespuestaT' component={EditarRespuestaT} />
                            <Route exact path='/crearRespuestaT' component={CrearRespuestaT} />
                            <Route exact path='/recursos' component={Recursos} />
                            <Route exact path='/editarRecurso' component={EditarRecurso} />
                            <Route exact path='/crearRecurso' component={CrearRecurso} />
                            <Route exact path='/exportar' component={Exportar} />
                        </Switch>
                    </main>
                </BrowserRouter>
            </div>
        );
    }
}
export default Dashboard;
